You can terminate a C program by using the `return` statement in the `main` function. When the `return` statement is executed, the program will exit and return control to the operating system. Alternatively, you can use the `exit` function from the `stdlib.h` library to terminate the program at any point in the code. For example:

```c
#include <stdlib.h>

int main() {
   // Your program code here

   // Terminate the program
   return 0;
}
```

or

```c
#include <stdlib.h>

int main() {
   // Your program code here

   // Terminate the program
   exit(0);
}
```

